	render() {
		return (
			<div>
				<div className="header">
					<div id="title">MATCH<span class="red">A</span></div>
					<div className="header-login"><Link to="login">Login</Link></div>
				</div>
				<div className="login">

				</div>
			</div>
		);
	}
}

export default Login;
